import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  Stack,
  TextField,
  TextStyle,
} from '@shopify/polaris';

class Index extends React.Component{

  render() {
    return <div>Index</div>;
    return (
      <Page>
        <Layout>
          <Layout.Index
            title="Default discount"
            description="Add a product to Sample App, it will automatically be discounted."
          >
            <Card sectioned>
              <div>Card</div>
            </Card>
          </Layout.Index>
        </Layout>
      </Page>
    );
  }


}

export default Index;
